import fetch from 'isomorphic-unfetch'

import Layout from '../components/Layout'
import Prices from '../components/Prices'

const Complex = ({data}) => {
  return (
    <Layout>
      <div>
        <h2>{data.Headline}</h2>
      </div>
    </Layout>
  )
}

/*
